# Distribution plot
def plot_dist(x, y, title, xaxis):

    # Initialize the matplotlib figure
    f, ax = plt.subplots(figsize = (13, 8))

    # Case plot
    sns.distplot(x[y == True],
                 bins = 5,
                 hist = True,
                 kde = True,
                 rug = False,
                 fit = None,
                 hist_kws = None,
                 kde_kws = None,
                 rug_kws = None,
                 fit_kws = None,
                 color = '#E17174',
                 vertical = False,
                 norm_hist = False,
                 axlabel = None,
                 label = 'True',
                 ax = None)

    # Control plot
    sns.distplot(x[y == False],
                 bins = 5,
                 hist = True,
                 kde = True,
                 rug = False,
                 fit = None,
                 hist_kws = None,
                 kde_kws = None,
                 rug_kws = None,
                 fit_kws = None,
                 color = '#71ACE1',
                 vertical = False,
                 norm_hist = False,
                 axlabel = None,
                 label = 'False',
                 ax = None)

    # Title / labels
    plt.title(title, fontdict = {'fontsize': 26})
    plt.xlabel(xaxis)

    # Setting legend
    plt.legend(loc = 'upper right')

    return


